import React from 'react'
import styled from 'styled-components'
import '../App.css';



function Home() {
    return (
        <Container >
            <p>---- GET HELP. GET BETTER. ----</p>
            <h1>A place to feel better,wherever you go!</h1>     
         </Container>



    )
}

export default Home

const Container=styled.div`
height:100%;
width:100%;
display:flex;
align-items:center;


p{
    color:red;
    font-size:19px;
    letter-spacing:1.42px;
    display:flex;
    width:522px;
    margin: 155px 738px 24px 180px;
}
h1{
    position:relative;
    font-size:40px;
    height:30px;
}
`
